import React from 'react';
import { Navbar, Container, Form, Button,Row ,Col} from 'react-bootstrap';

const Buttons = () => {
  return (
    <Row className="my-2 mb-5 ">
    <Col>
    <Button className='m-2'  >BreackFast</Button>
    <Button>Dinner</Button>
    <Button>3a4a</Button>
    <Button>All</Button>
    </Col>
    

    </Row>
  )
}

export default Buttons
